#!/usrlocal/bin/python


def isSubsequence(s, t):
    index = 0
    for chr in s:
        print(chr)
        index = t.find(chr,index)
        print(index)
        if index == -1:
            print("Not founc")
            return False
    return True


def main():
    s = "leeeeetcode"
    t = ""
    print(isSubsequence("abc", "ahbgdc"))
    print(isSubsequence(s,t))

if __name__ == '__main__':
    main()
